import streamlit as st 
import pandas as pd 
import numpy as np 
import pickle 
import tensorflow as tf 

st.set_page_config ( 
    page_title= 'Heart Attack Prediction', 
    page_icon= 'ðŸ«€'
)

st.title('Heart-Attack Predictor ðŸ«€')

model = tf.keras.models.load_model('Hear_Attack_predictor.h5') 

with st.sidebar : 
    st.image('data:image/jpeg;base64,')
    st.subheader('Predict the chance of a heart attack from given information about the patient.') 
    st.link_button('GitHub Link : Source Code' ,url ='https://github.com/Ashish-sinh/Heart-Attack-predictor') 

dataset = pickle.load(open('df.pkl','rb')) 

age = st.number_input('Enter Age of Heart Patient' , min_value= dataset['age'].min() , max_value= dataset['age'].max() , step= 20) 

select_gender =  st.selectbox('Select Gender of Patient',['Male','Female']) 

if select_gender == 'Male' : 
    gender = 1 
else : 
    gender = 0 
impluse = st.number_input('Enter Impluse of Patient', min_value= dataset["impluse"].min() , max_value= dataset['impluse'].max() , step= 100) 


hight_pressure , low_pressure = st.columns(2) 

pressurehight = hight_pressure.slider('Enter Hight of Pressure of Patient',min_value= dataset['pressurehight'].min()  ,max_value = dataset['pressurehight'].max() ) 
pressurelow = low_pressure.slider('Enter Bloof Pressure of Patient' , min_value = dataset['pressurelow'].min() , max_value = dataset['pressurelow'].max() ) 
glucose = st.slider('Enter the Level of Glucose of Patient', min_value = dataset['glucose'].min()  , max_value = dataset['glucose'].max() , format='%f') 


kcm = st.number_input("Enter Patient's Korotkoff's Cuff Measurement (KCM)" , min_value=dataset['kcm'].min() , max_value= dataset['kcm'].max() , step = 20.0 ) 

troponin = st.number_input('troponin' ,min_value=0.0001,  max_value=2.000, value=0.0001, format="%f", )

input = np.array([age, gender , impluse , pressurehight , pressurelow , glucose , kcm , troponin ]) 
input = input.reshape(1,-1)
prediction = model.predict(input) 
output = np.argmax(prediction) 


if st.button('Predict') : 
    if output == 0 : 
        st.subheader("You are safe , Your symptomps are not showing any chance of Heart-Attack") 
    else : 
        st.subheader('Sorry your symptom showing chance of Having Heart-Attack') 
